import React from "react";

import { createStackNavigator } from "@react-navigation/stack";

import SmartLocationPage from "./SmartLocationPage";
import SearchableContacts from "./SearchableContacts";

const Stack = createStackNavigator();

export default function SmartLocation() {
  return (
    <Stack.Navigator headerMode="none">
      <Stack.Screen component={SmartLocationPage} name="SmartLocationPage" />
      <Stack.Screen component={SearchableContacts} name="SearchableContacts" />
    </Stack.Navigator>
  );
}
